import {useEffect ,useState} from 'react';
import axios from './axios';

function App() {
  const [list,setList] = useState([]);
  useEffect(() => {
    async function fetchData(){
      const {data} = await axios.get('/');
      setList(data.results);
    }
    fetchData();
  },[])
  console.log(list)
  return (
    <div className="App">
      <h1>HELLO WORLD</h1>
      {
        list.map(listItem => (
          <p> title : {listItem.name.title} name : {listItem.name.first} last : {listItem.name.last}</p>
        ))
      }
    </div>
  );
}

export default App;
